const checkTime = 10000;
const updateTime = 2000;
const fadeTime = 1000;

var updater, last = {};

function getParameter(name) {
	return decodeURIComponent((new RegExp('[?|&]' + name + '=' + '([^&;]+?)(&|#|;|$)').exec(location.search) || [null, ''])[1].replace(/\+/g, '%20')) || null;
}

function showCover(str) {
	
	clearInterval(updater); last = {};
	
	if (str === 'invalid') $('#cover').attr('src', 'data:image/png;base64,');
	if (str === 'disabled') $('#cover').attr('src', 'data:image/png;base64,');
	if (str === 'unavailable') $('#cover').attr('src', 'data:image/png;base64,');
	
	$('#cover').fadeIn(fadeTime);
	
}

function hideCover() {
	
	setTimeout(function() {
		$('#cover').fadeOut(fadeTime);
	}, 1000);
	
}

setInterval(check, checkTime);

check();
function check() {
	
	$.get('/getpanel?id=' + getParameter('id')).done(function(panel) {
		
		if (!panel.enabled) return showCover('disabled');
		
		hideCover();
		
		if (JSON.stringify(panel) === JSON.stringify(last)) return;
		last = panel;
		
		$('#stops').css('zoom', 1.6 + panel.zoom);
		
		$('#bar').css('height', 156 + panel.height + 'px');
		$('#bar').css('background', panel.color);
		
		$('#bar-logo').attr('src', 'assets/' + panel.logo + '.png');
		
		var content = '';
		var ids = [];
		
		for (var i = 0; i < panel.stops.length; i++) {
			var stop = panel.stops[i];
			
			ids.push(stop.id);
			
			content += '<div id="stop-' + i + '" class="stop">';
			content +=   '<div class="stop-top" style="background: ' + stop.color + ';">';
			content +=     '<span class="stop-name">' + stop.name + '</span><br>';
			content +=     '<span class="stop-desc">' + stop.desc + '</span>';
			content +=   '</div>';
			content +=   '<div class="stop-trips"></div>';
			content += '</div>';
			
		}
		
		document.getElementById('stops').innerHTML = content;
		
		$('.stop').css('width', 'calc(100% / ' + panel.stops.length + ')');
		
		if (updater) return;
		
		updater = setInterval(function() {
			update(ids);
		}, updateTime);
		
	}).fail(function(xhr) {
		
		if (xhr.status === 401) showCover('invalid');
		if (xhr.status === 402) showCover('disabled');
		
	});
	
}

function update(ids) {
	
	for (let i = 0; i < ids.length; i++) {
		let id = ids[i];
		
		$.get('/gettrips?id=' + id).done(function(trips) {
			
			var content = '';
			
			for (var j = 0; j < trips.length; j++) {
				var trip = trips[j];
				
				content += '<div class="trip">';
				content +=   '<img class="trip-type" src="//bussiaeg.ee/assets/' + (trip.type === 'bus' ? trip.owner ? 'bus_' + trip.owner : 'bus' : trip.type) + '.png" alt="">';
				content +=   '<div class="trip-short_name">' + trip.short_name + '</div>';
				content +=   '<div class="trip-long_name">' + trip.long_name + '</div>';
				content +=   '<div class="trip-time">' + trip.time + '</div>';
				content +=   '<div class="trip-alt_time">' + (trip.panel || trip.alt_time) + '</div>';
				content += '</div>';
				
			}
			
			$('#stop-' + i + ' .stop-trips').html(content);
			
		});
		
	}
	
}